// write html , js , css 
// components -- javscript function / classes
// 2 types
// 1.Functional component  -- stateless component
// 2.class based component  -- statelfull component

// how to make component  -- 
// jsx  --> javscrip[t extension 
    //   --->using jsx olne we can write html code in directly react app

// jsx rules 
// 1.function name / class name first letter sholud be capital
// 2.return key word
// 3.any one block element -- div,main,section,article,aside
// 4.html attributes are camel casse 
    // onclick    --- onClick
// 5.id = id, class = className
// 6.every tag open and close is mandatory
    // <img></img>  || <img/>

    //export default component_name-----to execute the code


    export function App(){
        return(
            <div>
                <thead>
                    <tr>
                        <th>s.no</th>
                        <th>full name</th>
                        <th>city</th>
                        <th>state</th>
                        <th>mobile no</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>1</td>
                        <td>vijay</td>
                        <td>bangloore</td>
                        <td>karnataka</td>
                        <td>56789452</td>
                    </tr>
                    <tr>
                        <td>1</td>
                        <td>vijay</td>
                        <td>bangloore</td>
                        <td>karnataka</td>
                        <td>56789452</td>
                    </tr> 
                    <tr>
                        <td>1</td>
                        <td>vijay</td>
                        <td>bangloore</td>
                        <td>karnataka</td>
                        <td>56789452</td>
                    </tr>
                     <tr>
                        <td>1</td>
                        <td>vijay</td>
                        <td>bangloore</td>
                        <td>karnataka</td>
                        <td>56789452</td>
                    </tr>
                     <tr>
                        <td>1</td>
                        <td>vijay</td>
                        <td>bangloore</td>
                        <td>karnataka</td>
                        <td>56789452</td>
                    </tr>
                     <tr>
                        <td>1</td>
                        <td>vijay</td>
                        <td>bangloore</td>
                        <td>karnataka</td>
                        <td>56789452</td>
                    </tr>
                </tbody>
            </div>
        )
    }

    //export default App;
    export function Helo(){
        return(
            <div>
                <form>
                    <label>Name:</label>
                    <input type="text"/>
                    <br/><br/>
                    <label>Email:</label>
                    <input type="text"/>
                    <br/><br/>
                    <label>Password:</label>
                    <input type="password"/>
                    <br/><br/>
                    <input type="submit"/>
                </form>
            </div>
        )
    } 
    //export default Helo;
